  false,\n\t\"url\": null,\n\t\"notes\": \"A duck brood survey was conducted on the
  Koyukuk National Wildlife Refuge from 16 July to 11 August 1984. Thirty plots, one
  square-mile in size, were censused. Thirteen duck species, for a total of 255 broods,
  were observed in the plots. Brood density was 8.50 broods/square-mile. The total
  refuge population of young ducks was estimated at 130,183.\",\n\t\"license_title\":
